import { useState, useEffect } from 'react';
import axios from 'axios';

import './App.css';

function App() {

  useEffect(() => {
    let cancel
    axios.get('https://pokeapi.co/api/v2/pokemon', {
      cancelToken: new axios.CancelToken(c => cancel = c)
    })
  })

  return (
    <div className="App">
      {null}
    </div>
  );
}

export default App;
